import React, {useEffect} from 'react';


function Footer(props) {

  var date = new Date().getFullYear();
  const scrooltoTop  = React.useRef();


  useEffect(() => {
    window.onscroll(0, 0)
  }, []);




  return(

    <>
    <footer>
        <section  className="footer-area">
          <hr/>
            <div className="container-fluid">
                <div className="row">
                    <div className="w-100"></div>
                    <div className="col-md-12">
                       <p className="text-muted"><small>&copy; {date} -  Fitness All Rights Reserved.</small></p>
                    </div>
                </div>
            </div>
          </section>
    </footer>

 <button ref={scrooltoTop} id="myBtn" title="Go to top" class="topbtn shadow px-3 py-2 rounded"><i class="fa fa-angle-up"></i></button>
    </>

  );

}

export default Footer;
